import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './pages/Login'; // Đường dẫn tới Login.js trong thư mục pages
import Dashboard from './pages/Dashboard';
import AddStudent from './pages/AddStudent';
import EditStudent from './pages/EditStudent';
import Header from './components/Header'; // Đường dẫn tới Header.js trong thư mục components

function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Login />} /> {/* Trang mặc định */}
        <Route path="/login" element={<Login />} /> {/* Thêm Route rõ ràng */}
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/add" element={<AddStudent />} />
        <Route path="/edit/:id" element={<EditStudent />} />
      </Routes>
    </Router>
  );
}

export default App;
